import React from 'react'

import { Sidebar } from '../components/Sidebar'

import { getProfile } from '../utils/spotify'

const Home = async () => {
    var data = await getProfile();
    return (
        <div className='grid grid-cols-2'>
            <Sidebar />
            {JSON.stringify(data).toString()}
        </div>
    )
}

export default Home
